// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract Assessment {
    address public owner;
    uint256 public balance;
    uint256 public totalDeposits;
    uint256 public totalWithdrawals;
    uint256 public lastDepositTime;
    uint256 public lastWithdrawTime;

    // Event declarations
    event Deposit(uint256 amount);
    event Withdraw(uint256 amount);

    // Constructor to set the owner on deployment
    constructor() {
        owner = msg.sender;
        balance = 0;
        totalDeposits = 0;
        totalWithdrawals = 0;
        lastDepositTime = 0;
        lastWithdrawTime = 0;
    }

    // Modifier to ensure the caller is the owner
    modifier onlyOwner() {
        require(msg.sender == owner, "You are not the owner of this account");
        _;
    }

    // Deposit function to deposit funds into the ATM
    function deposit(uint256 _amount) public payable onlyOwner {
        require(_amount > 0, "Deposit amount must be greater than 0");

        // Increase balance and total deposits
        balance += _amount;
        totalDeposits += _amount;

        // Update the last deposit time
        lastDepositTime = block.timestamp;

        // Emit the Deposit event
        emit Deposit(_amount);
    }

    // Withdraw function to withdraw funds from the ATM
    function withdraw(uint256 _amount) public onlyOwner {
        require(_amount > 0, "Withdrawal amount must be greater than 0");
        require(balance >= _amount, "Insufficient funds in ATM");

        // Decrease balance and total withdrawals
        balance -= _amount;
        totalWithdrawals += _amount;

        // Update the last withdraw time
        lastWithdrawTime = block.timestamp;

        // Emit the Withdraw event
        emit Withdraw(_amount);

        // Transfer the amount to the owner's address
        payable(owner).transfer(_amount);
    }

    // Getter functions to fetch the ATM state
    function getBalance() public view returns (uint256) {
        return balance;
    }

    function getTotalDeposits() public view returns (uint256) {
        return totalDeposits;
    }

    function getTotalWithdrawals() public view returns (uint256) {
        return totalWithdrawals;
    }

    function getLastDepositTime() public view returns (uint256) {
        return lastDepositTime;
    }

    function getLastWithdrawTime() public view returns (uint256) {
        return lastWithdrawTime;
    }
}

